        [Test]
        public void JV_CK_CHAKUDataBridge_BuildUpCreateTableCommand_can_build_executable_table_creation_command()
        {
            // Arrange
            var dataBridge = NewJV_CK_CHAKUDataBridge("CK22023082820230826010205082019102663クローズユアアイズ　　　　　　　　　古川　吉洋　　　　　　　　　　　　昆　貢　　　　　　　　　　　　　　株式会社　ＮＩＣＫＳ　　　　　　　　　　　　　　　　　　　　　　ＮＩＣＫＳ　　　　　　　　　　　　　　　　　　　　　　　　　　　20230000525500000000377000000300000200000200000000000100002400000019282950000027950000006600005000004300002000003900022870004800大北牧場　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　大北牧場　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　202300012253000000005870000004000009000004000006000007000046000000440643000000467324000216000257000228000245000247002048\r\n",
                                                      JVOpenOptions.Normal);

            using (var conn = new SQLiteConnection("Data Source=:memory:"))
            {
                conn.Open();
                using (var cmd = conn.CreateCommand())
                {
                    // Act
                    var cmdCache = cmd.NewPreparedCache(conn.BeginTransaction());
                    foreach (var bltCmd in dataBridge.BuildUpCreateTableCommand(cmdCache))
                    {
                        bltCmd.ExecuteNonQuery();
                    }

                    // Assert
                    cmd.AssertTableCreation("NL_CK_CHAKU", JVDataStructColumns.CK);
                }
            }
        }

        [Test]
        public void JV_CK_CHAKUDataBridge_BuildUpCreateTableCommand_can_create_sql_runs_multiple_times_without_error()
        {
            // Arrange
            var dataBridge = NewJV_CK_CHAKUDataBridge("CK22023082820230826010205082019102663クローズユアアイズ　　　　　　　　　古川　吉洋　　　　　　　　　　　　昆　貢　　　　　　　　　　　　　　株式会社　ＮＩＣＫＳ　　　　　　　　　　　　　　　　　　　　　　ＮＩＣＫＳ　　　　　　　　　　　　　　　　　　　　　　　　　　　20230000525500000000377000000300000200000200000000000100002400000019282950000027950000006600005000004300002000003900022870004800大北牧場　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　大北牧場　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　202300012253000000005870000004000009000004000006000007000046000000440643000000467324000216000257000228000245000247002048\r\n",
                                                      JVOpenOptions.Normal);

            using (var conn = new SQLiteConnection("Data Source=:memory:"))
            {
                conn.Open();
                using (var cmd = conn.CreateCommand())
                {
                    // Act
                    var cmdCache = cmd.NewPreparedCache(conn.BeginTransaction());
                    var bltCmds = new List<SQLitePreparedCommand>();
                    foreach (var bltCmd in dataBridge.BuildUpCreateTableCommand(cmdCache))
                    {
                        bltCmd.ExecuteNonQuery();
                        bltCmds.Add(bltCmd);
                    }

                    // Assert
                    foreach (var bltCmd in bltCmds)
                    {
                        Assert.DoesNotThrow(() => bltCmd.ExecuteNonQuery(), bltCmd.GetLoggingQuery());
                    }
                }
            }
        }

